import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Homepage from "./HomePage";
import HeroSection from "./hero";
import BlogPost from "./Blogs";
import Membership from "./MembershipCard";
import AboutHimani from "./AboutFounder";
import FooterPost from "./footer";
import LoginPage from "./LoginPage"; // Import your LoginPage component

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <Homepage />
          </Route>
          <Route path="/hero">
            <HeroSection />
          </Route>
          <Route path="/blogs">
            <BlogPost />
          </Route>
          <Route path="/membership">
            <Membership />
          </Route>
          <Route path="/about">
            <AboutHimani />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
          <Route path="/footer">
            <FooterPost />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
